import React from 'react'

const Employees = () => {
  return (
      <table class="table-auto">
        <thead>
          <tr>
            <th>ID</th>
            <th>Name</th>
            <th>Designation</th>
            <th>Salary</th>
          </tr>
        </thead>
      </table>
  );
}

export default Employees;
